import { useState } from "react";
export function Mainn() {
  const initialValidOrNot = [
    { 1: "valid" },
    { 2: "notValid" },
    { 3: "notValid" },
  ];
  let [validOrNot, setValidOrNot] = useState(initialValidOrNot);
  function sss() {
    setValidOrNot([{ 1: "notValid" }, { 2: "notValid" }, { 3: "notValid" }]);
  }
  function changeValid(n) {
    let tempState = [...validOrNot];
    let tempElement = { ...tempState[n] };
    tempElement = "valid";
    tempState[n] = tempElement;
    setValidOrNot(tempState);
  }
  return (
    <div className="mainn">
      <div className="d-flex align-items-center justify-content-center figure">
        <img
          src="https://d33wubrfki0l68.cloudfront.net/2412cfbc443beec064c6a662be23adfa4bb9cbb6/e883c/assets/planet-mercury.svg"
          alt=""
          style={{
            width: "200px",
          }}
        />
      </div>
      <div className="about">
        <div>
          <h1 className="mb-4" style={{ fontSize: "45px" }}>
            MERCURY
          </h1>
          <p
            style={{
              color: "white",
              fontFamily: "Spartan, sans-serif",
              fontSize: "12px",
              lineHeight: "25px",
              marginBottom: "35px",
            }}
          >
            Mercury is the smallest planet in the Solar System and the closest
            to the Sun. Its orbit around the Sun takes 87.97 Earth days, the
            shortest of all the Sun's planets. Mercury is one of four
            terrestrial planets in the Solar System, and is a rocky body like
            Earth.
          </p>
          <p
            style={{
              fontSize: "12px",
              fontFamily: "Spartan, sans-serif",
              color: "#eee",
              color: "#7A7A89",
              margin: 0,
            }}
          >
            Source :
            <a
              href="https://en.wikipedia.org/wiki/Mercury_%28planet%29"
              target="_blank"
            >
              <b
                style={{
                  fontFamily: "Spartan, sans-serif",
                  color: "#eee",
                  color: "#7A7A89",
                }}
              >
                Wikipedia
              </b>
              <img
                src="https://d33wubrfki0l68.cloudfront.net/7161506cc08ae44d2b3d0adead5ed19c0f4806a0/7c131/assets/icon-source.svg"
                alt="Source Icon"
                style={{
                  width: "10px",
                  height: "10px",
                  margin: 0,
                  marginLeft: "3px",
                  marginBottom: "5px",
                }}
              ></img>
            </a>
          </p>
        </div>
      </div>
      <div
        className="d-flex flex-column justify-content-end  choose h-100"
        style={{ gap: "17px" }}
      >
        <button
          className={validOrNot[0]}
          onClick={() => {
            sss();
            changeValid(0);
          }}
        >
          <span>01</span> OVERVIEW
        </button>
        <button
          className={validOrNot[1]}
          onClick={() => {
            sss();

            changeValid(1);
          }}
        >
          <span>02</span>STRUCTURE
        </button>
        <button
          className={validOrNot[2]}
          onClick={() => {
            sss();

            changeValid(2);
          }}
        >
          <span>03</span>SURFACE
        </button>
      </div>
      <div>
        <div className="d-flex justify-content-between details">
          <div>
            <div>
              <p>ROTATION TIME</p>
              <h6>58.6 DAYS</h6>
            </div>
          </div>
          <div>
            <div>
              <p>REVOLUTION TIME</p>
              <h6>58.6 DAYS</h6>
            </div>
          </div>
          <div>
            <div>
              <p>RADIUS</p>
              <h6>58.6 DAYS</h6>
            </div>
          </div>
          <div>
            <div>
              <p>AVERAGE TEMP.</p>
              <h6>58.6 DAYS</h6>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
